//const logoReEx = require("../../img/logoReEx.png");

const Navbar = () => {
  return (
    <nav className="navbar bg-dark">
      {/* <h1> */}
      <a href="index.html">
        <img
          src={require("../../img/logoReEx.png")}
          class="img-fluid"
          alt="logo"
        ></img>
      </a>
      {/* </h1> */}
      <ul>
        <li>
          <a href="register.html">Register</a>
        </li>
        <li>
          <a href="login.html">Login</a>
        </li>
        <li>
          <a href="login.html">Logout</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
